import React from "react";
import "./style.css"
import Container from 'reac'

function Jumbotron() {
    return (
        <div>
            <Jumbotron fluid>
                <Container>
                    <h1>Fluid jumbotron</h1>
                    <p>
                        This is a modified jumbotron that occupies the entire horizontal space of
                        its parent.
                     </p>
                </Container>
            </Jumbotron>
        </div>
    );
}

export default Jumbotron;
